import Logo from "./Logo"
import Silinecek from "./Silinecek"
import MenuItems from "./MenuItems"
import { useState } from "react"

const Header=()=>{
  
    const [headers]=useState([
      {
        id:1,
        title:"kayda gecmis korona degerleri"
      },
      {
        id:1,
        title:"kitalara gore"
      },
      {
        id:1,
        title:"ulkelere gore"
      }
    ])
    return(
      <nav className='bg-gray-800  border-gray-200 px-2 py-2.5 '>
         <div className=' container flex flex-wrap justify-between item-center items-center mx-auto  '  >
           <Logo></Logo>
           <div className='w-auto block '>
                <ul className='flex flex-row mt-4 font-semibold text-xs space-x-8 mt-0 '>
                    {headers.map((item)=>{
                      return(
                        <MenuItems title={item.title} onClick={(title) => {
                          setActiveTitle(title)
                          onMenuChange(item.value)
                      }} title={item.title}/>
                      )
                    })}
                </ul>
            </div>
         </div>
      </nav>
    )
}

export default Header
